import React from "react";
import List from "./List";

const Birthday = () => {
  return (
    <div className="bg-pink-500 w-full  h-screen flex justify-center items-center">
      <div className="bg-white w-[400px] h-[200px] rounded-md shadow-md shadow-gray-900">
        <h2 className="text-xl opacity-50 ml-12   mt-2">0 Birthday today</h2>
        <List />
        <button
          onClick={() => console.log("click")}
          className="bg-pink-500 ml-12 px-20 py-1 "
        >
          Clear All
        </button>
      </div>
    </div>
  );
};

export default Birthday;
